import React from 'react'
import './styles.css'
import Card from './Card'
import pokemon from '../../pokemon'

function createCard(poke) {
    return <Card
    key={poke.id}
    img={poke.img}
    name={poke.name}
    text={poke.text}
    />
}

function Main() {
  return (
    <div>
        <h1>
            <span>Poke Mapping</span>
        </h1>

        <dl className='dictionary'>
         <img src="/images/Bulbasaur.png" alt="asd" />
            
        </dl>
        
    </div>
  )
}

export default Main
